Saya mencoba `break` di Pelican Static blog.

üï∑ https://jinja.palletsprojects.com/en/2.10.x/templates/#loop-controls

```    <ul class="widget-list">
    {% for title, url in FRIENDS %}
    {% if loop.index >= 5 %}{% break %}{% endif %}
    <li><a href="{{ url }}">{{ title }}</a></li>
    {% endfor %}
    </ul>```

Dan hasilnya keluar error:

`Caught exception "TemplateSyntaxError: Encountered unknown tag 'break'. Jinja was looking for the following tags: 'elif' or 'else' or 'endif'.`

Kalau di **nunjucks** memakai `limit`:

```  {% set links = friends| shuffle | limit(5) %}

  <ul class="widget-list">
    {%- for friend in links -%}
    <li><a href="{{ friend.url }}"
      >{{ friend.title }}</a></li>
    {%- endfor -%}
  </ul>```

Dapat dengan cara seperti ini:

```    <ul class="widget-list">
    {% for title, url in FRIENDS[5] %}
      {% if loop.index <= 5 %}
      <li><a href="{{ url }}">{{ title }}</a></li>
      {% endif %}
    {% endfor %}
    </ul>```

Namun rasanya kurang elegan.

Navigasi di Pelican dapat dengan membuat filter sendiri ü•≥.

```def filter_navigation(articles_by_dates, article):
  result = {'has_prev': False, 'has_next': False, 'id': -1}

  for index, post in enumerate(articles_by_dates):
    if post.url == article.url: result['id'] = index

  if result['id'] + 1 > 1:
    result['has_prev'] = True

    for index, post in enumerate(articles_by_dates):
      if index == result['id'] - 1:
        result['prev_url']   = post.url
        result['prev_title'] = post.title

  if result['id'] + 1 < len(articles_by_dates):
    result['has_next'] = True

    for index, post in enumerate(articles_by_dates):
      if index == result['id'] + 1:
        result['next_url']   = post.url
        result['next_title'] = post.title

  return result```

